import React from 'react';
import './index.css';
import './comadreja.scss';
import 'bootstrap/dist/css/bootstrap.css';

function App() {
  return (
    <div>
      <form>
        <h2>Registrar Empresa</h2>
        <div>
          <input className="form-control form-control-lg focus-secondary" type="text" id="empresaNombre" placeholder="Nombre de la empresa" />
        </div>
        <div>
          <input type="emal" type="text" id="empresaNombre" placeholder="Nombre de la empresa" />
        </div>
      </form>
    </div>
  );
}

export default App;
